-- Para recibir fechas en formato dd/mm/aaaa
SET DATESTYLE TO 'European';

-- Crearemos una función que nos sirva para realizar las inserciones en la tabla boleto
CREATE OR REPLACE FUNCTION fnc_registraboleto(
	pfecha_compra DATE,
	phora_compra TIME,
	pfecha_vuelo DATE,
	phora_abordaje TIME,
	pnumero_asiento INTEGER,
	phora_aterrizaje TIME,
	pidavion INTEGER,
    pidcliente INTEGER,
    pidpago INTEGER,
    piddescuento INTEGER,
	piddestino INTEGER,
    pidsalida INTEGER,
	pidvuelo INTEGER
)
RETURNS VARCHAR(20)
AS
$$
DECLARE vidboleto INTEGER;
DECLARE vmaximo INTEGER;
BEGIN
	
	IF(pidsalida = piddestino) THEN
	
	RETURN 'No se puede hacer la inserción';
	
	ELSE
	
	-- Obtenemos el máximo de los id
	vmaximo = (SELECT MAX(IdBoleto) FROM Boleto);
	
		-- Obtenemos el nuevo id
		IF(vmaximo IS NULL) THEN
		
		vidboleto = 1;
		
		ELSE
		
		vidboleto = (vmaximo + 1);
		END IF;
	
	-- Hacemos la inserción
	INSERT INTO Boleto (IdBoleto,Fecha_Compra,Hora_Compra, fecha_vuelo, Hora_Abordaje, Numero_Asiento,Hora_Aterrizaje, IdAvion,IdCliente, IdPago, IdDescuento, IdDestino, IdSalida, IdVuelo)
	VALUES (vidboleto, pfecha_compra, phora_compra, pfecha_vuelo, phora_abordaje, pnumero_asiento,phora_aterrizaje, pidavion, pidcliente, pidpago, piddescuento, piddestino , pidsalida, pidvuelo);
	
	RETURN 'Inserción Exitosa';
	
	END IF;

END;
$$
LANGUAGE 'plpgsql' VOLATILE;

